import React from "react";

const Home = () => {
  return (
    <div className="container">
      <div className="Home">
        <section className="Home-section1">
          <p className="lead">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Eget
            nunc lobortis mattis aliquam faucibus purus in massa. Id cursus
            metus aliquam eleifend mi in nulla posuere. Amet venenatis urna
          </p>
        </section>
        <section className="Home-section2"></section>
        <section className="Home-section3"></section>
        <section className="Home-section4"></section>
      </div>
    </div>
  );
};
export default Home;
